-- ----------------------------
-- View structure for `aty_cmt_user`
-- ----------------------------
DROP VIEW IF EXISTS `aty_cmt_user`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `aty_cmt_user` AS select `activity`.`atyId` AS `atyId`,`user`.`userName` AS `userName`,`user`.`userIcon` AS `userIcon`,`comment`.`cmtContent` AS `cmtContent`,`comment`.`cmtTime` AS `cmtTime` from (((`activity` join `evaluation`) join `user`) join `comment`) where ((`activity`.`atyId` = `evaluation`.`userId`) and (`user`.`userId` = `evaluation`.`userId`) and (`comment`.`cmtId` = `comment`.`cmtId`)) ;
DROP TRIGGER IF EXISTS `update_aty_credit`;
DELIMITER ;;
CREATE TRIGGER `update_aty_credit` BEFORE UPDATE ON `activity` FOR EACH ROW BEGIN
DECLARE num int;
DECLARE cid varchar(50);
SET NEW.atyCredit = (NEW.atyMembers - OLD.atyMembers)*2 + (NEW.atyLikes-OLD.atyLikes) + OLD.atyCredit;
SET cid = (SELECT ctyId FROM distribute where distribute.atyId = OLD.atyId);
SET num = (SELECT ctyNumOfAty 
                 FROM communnity
                 where ctyId = cid
                 );
UPDATE communnity
SET ctyCredit = (ctyCredit * num + NEW.atyCredit - OLD.atyCredit) / (num+1)
where ctyId = cid;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_cty_credit`;
DELIMITER ;;
CREATE TRIGGER `update_cty_credit` BEFORE UPDATE ON `communnity` FOR EACH ROW BEGIN
IF NEW.ctyMembers !=OLD.ctyMembers or NEW.ctyNumOfAty != OLD.ctyNumOfAty then
SET NEW.ctyCredit = (NEW.ctyMembers - OLD.ctyMembers)*2 + (NEW.ctyNumOfAty - OLD.ctyNumOfAty)*0.5 + OLD.ctyCredit;
END IF;
END
;;
DELIMITER ;
